import React, { Component } from "react";
import Layout from "../../components/Layout";
import Head from "next/head";
import {
    BrowserView,
    MobileView,
  } from "react-device-detect";
class Theresume extends Component {

    render() {
        return (           
            <Layout title = "The Resume Game | AOWSAY">
                <BrowserView>
                <style jsx>{`
                    iframe 
                    {
                        display: block; 
                        margin: 0;
                        width: 100%;
                        height: 100%;
                        border: none; 
                        overflow-y: auto; 
                        overflow-x: hidden;                         
                    }
                `}</style>
                </BrowserView>
                <MobileView>
                <style jsx>{`
                    iframe 
                    {
                        display: block; 
                        margin: 0;
                        position: absolute;
                        top: 0;
                        left: 0;
                        width: 100%;
                        height: 100%;
                        border: none; 
                        overflow-y: auto; 
                        overflow-x: hidden;                         
                    }
                `}</style>
                </MobileView>
                                
                <div className="container text-center">
                    <h1>The Resume Game</h1>
                    <div className="row d-flex justify-content-center">                        
                        <div className="shadow-lg p-3 mb-5 bg-dark rounded">
                            <iframe frameborder="0" src="https://itch.io/embed-upload/1857824?color=333333" allow="fullscreen">
                                <a href="https://msomsap.itch.io/the-resume-game">Play The  Resume Game on itch.io</a>
                            </iframe>
                        </div>
                    </div>
                    <br />
                </div>          
            </Layout>
        )
    }
}

export default Theresume;
